<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <meta http-equiv="X-UA-Compatible" content="ie=edge">
  <title>Document</title>
  <link rel="stylesheet" href="objectmanage.css">
</head>
<body>
  <div class="object-manage">
    <div class="setupheader">
      <div class="part-left">
        <div class="image">
          <img src="" alt="">
        </div>
        <div class="description-msg">
          <span>设置</span>
          <p>对象管理器</p>
          <h6>36 个项目，按标签排序</h6>
        </div>
      </div>
      <div class="part-right">
        <input type="text" class="search-input" placeholder="快速查找">
        <div class="select"></div>
      </div>
    </div>
    <div class="setupcontent">
      <div class="table-header">
        <div class="cell-label">标签</div>
        <div class="cell-name">API名称</div>
        <div class="cell-des">描述</div>
        <div class="cell-modify">上次修改时间</div>
        <div class="cell-deploy">已部署</div>
        <div class="cell-defined">自定义</div>
        <div class="cell-blank"></div>
      </div>
      <div class="table-content">
        <div class="cell-label cell-title">标签</div>
        <div class="cell-name">API名称</div>
        <div class="cell-des">描述</div>
        <div class="cell-modify">上次修改时间</div>
        <div class="cell-deploy">已部署</div>
        <div class="cell-defined">自定义</div>
        <div class="cell-blank"></div>
      </div>      
    </div>
  </div>
</body>
</html>
